import styled from 'styled-components';

export const Header = styled.header`

  height: 740px;
  width: 1280px;
  `;

export const StyledHeaderImage = styled.img`
z-index: 0;
position: absolute;

`;

export const InfoAboutBlurred = styled.img`
position: absolute;
  width: 499px;
  height: 450px;
  z-index: 1;
top: 171px;
left: 132px;
box-shadow: inset 0 0 2000px rgba(0, 0, 0, .8);
  filter: blur(10px);
  box-shadow: 0.2px 0.2px 0 rgb(255, 255, 255);



`;
